//libreria
import React from 'react';
//componentes
import ModalBase from '../ModalBase';
//estilos
import './'
const Accesos =({onCerrar})=>{
    return (<ModalBase titulo="Accesos." onCerrar={onCerrar}>
            <div className="cuerpo-modal">
                Accesos
            </div>
    </ModalBase>);
}

export default Accesos;
